schemaDefinition: "create or replace view SYS_USER(\n\t\"UserSysID\",\n\t\"UserFirstName\"\
  ,\n\t\"UserLastName\",\n\t\"UserName\",\n\t\"UserUserName\",\n\t\"UserEmail\",\n\
  \t\"Active\",\n\t\"UserJobLevel\",\n\t\"UserJobRole\",\n\t\"UserUserSource\",\n\t\
