  ,\n\t\"Source\",\n\t\"LastLogin\",\n\t\"UserCompany\",\n\t\"UserCompanyAccount_CC\"\
  ,\n\t\"UserSysCreatedOn\",\n\t\"UserAccountLabel\",\n\t\"UserAccountValue\"\n) as\
  \ -- SEMANTIC LAYER BEGINS\n\nSELECT \"SYS_ID\" as \"UserSysID\",\n       \"FIRST_NAME\"\
  \ as \"UserFirstName\",\n       \"LAST_NAME\" as \"UserLastName\",\n       \"NAME\"\
  \ as \"UserName\",\n       \"USER_NAME\" as \"UserUserName\",\n       \"EMAIL\"\
  \ as \"UserEmail\",\n       \"ACTIVE\" as \"Active\",\n       \"DV_U_JOB_LEVEL\"\
  \ as \"UserJobLevel\",\n       \"DV_U_JOB_ROLE\" as \"UserJobRole\",\n       \"\
  DV_U_USER_SOURCE\" as \"UserUserSource\",\n       \"DV_COUNTRY\" as \"UserCountry\"\
  ,\n       \"U_IS_PARTNER\" as \"IsPartner\",\n       \"U_IS_CUSTOMER\" as \"IsCustomer\"\
  ,\n       \"U_IS_PROSPECT\" as \"IsProspect\",\n       \"U_ACCOUNT_NUMBER\" as \"\
  UserAccountNumber\",\n       \"SOURCE\" as \"Source\",\n       \"LAST_LOGIN\" as\
  \ \"LastLogin\",\n       \"COMPANY\" as \"UserCompany\",\n       \"U_COMPANY_ACCOUNT\"\
  \ as \"UserCompanyAccount_CC\",\n       \"SYS_CREATED_ON\" as \"UserSysCreatedOn\"\
  ,\n       \"U_ACCOUNT\" as \"UserAccountLabel\",\n       \"DV_U_ACCOUNT\" as \"\
  UserAccountValue\"\nFROM \"RDS\".\"NOWLEARNING\".\"SYS_USER\";"
